import React from "react";

const Signup = () => {
  return (
    <div className="addUser">
      <h3> Add New User</h3>
      <form className="addUserForm">
        <div className="inputGroup">
          <label htmlFor="name">Name:</label>
        </div>
      </form>
    </div>
  );
};

export default Signup;
